import { motion } from "framer-motion"
import "../App.css"

function Beginning (){

return (<div className="containter">
 <motion.div className="box"
    
    animate={{
    x:50, y:100, opacity:1
    }}
    transition={{
    delay:0.2,
    x:{type:"spring", stiffness:20},
    default:{duration:2}
    }}> 
    
    <h2>hola</h2>

</motion.div>



</div>);
}
export default Beginning;
